	jal gerarCrocodilo
	jal iniLocalPersonagem
	j   Personagem
	jal MOVE
	
	# __________ >>> ENDPROGRAM <<< __________ #
	addi $2, $zero, 10
	syscall
	
	reset: jr $31
	
	gerarCenario:
	
		lui  $s0, 0x1001   # inicio do endereco de memoria
		addi $s2, $0, 8192 # dimensoes: 128 x 64 = 8192
		
		for_gCenario: beq $s2, 0, reset
		
			      lw   $4, 32768($s0)
			      sw   $4,     0($s0)
			      addi $s0, $s0, 4  # +4 bytes
			      
			      addi $s2, $s2, -1 # decremento
			      
			      j for_gCenario
	
	gerarCrocodilo:
		addi $t8, $zero, 0x143800 # cor do Crocodilo
		addi $a1, $zero, 66 	  # c: coluna
		addi $a2, $zero, 34	  # l: linha
		
		add $s7, $zero, $31   # backup JAL
		add $t0, $zero, $zero # reseta iterador

		# &pX = &p0 + (l * L + c) * 4
		mul $t6, $a2, $k1
		add $t6, $t6, $a1
		sll $t6, $t6, 2
		add $t6, $t6, $s0

		sw   $t8, 0($t6)
		sw   $t8, 4($t6)
		addi $t6, $t6, 480
		jal  for_gCrc

		addi $t6 $t6, 468
		sw   $t8, 0($t6)
		sw   $t8, 8($t6)
		sw   $t8, 16($t6)
		sw   $t8, 24($t6)
		sw   $t8, 36($t6)
		sw   $t8, 40($t6)

		add $t0, $zero, $zero # reseta iterador

		addi $t6, $t6, 508
		jal  for_gCrc

		j EXIT_gerarCrocodilo

		for_gCrc: beq $t0, 12, reset

			sw   $t8, 0($t6)
			addi $t6, $t6, 4

			addi $t0, $t0, 1 # incremento
			j for_gCrc

	EXIT_gerarCrocodilo: add $31, $zero, $s7 # restaura backup JAL
		  	     j reset
	
	iniLocalPersonagem:
		
		lui  $s1, 0x1001
		addi $s1, $s1, 12320
		
		j reset
	
	Personagem:
		lui $t1, 0x1001
		beq $fp,  1, case_1
		beq $fp, -1, case_2
		
		case_1:
			addi $fp, $zero, 1
			lw   $4, 65536($t1)
			jal  gerarPersonagem
			j    MOVE
		case_2:
			addi $fp, $zero, -1
			lw   $4, 65920($t1)
			jal  gerarPersonagem
			j    MOVE
		
		gerarPersonagem:
			add  $t2, $zero, $s1 # t2: localizacao inicial do Personagem
			addi $s0, $zero, 6   # s0: coluna
			addi $s2, $zero, 15  # s2: linha

			j gerarPersonagem_L
		
		gerarPersonagem_C: beq $s2, $zero, reset
				   
				   addi $t2, $t2, 488
				   addi $s0, $s0, 6
				   addi $s2, $s2, -1
		
		gerarPersonagem_L: beq $s0, $zero, gerarPersonagem_C
				   
				   beq $fp,  1, STATE_1
				   beq $fp, -1, STATE_2
				   
				   STATE_1: lw $4, 65536($t1)
				   	    j pintar
				   	    
				   STATE_2: lw $4, 65920($t1)
				   	
				   pintar: beq $4, 0x000000, skip_black_color
				   
					   sw   $4, 0($t2)
					   addi $t1, $t1, 4
					   addi $t2, $t2, 4
					   addi $s0, $s0, -1
				   
					   j gerarPersonagem_L
					   
					   skip_black_color:
						   addi $t1, $t1, 4
						   addi $t2, $t2, 4
						   addi $s0, $s0, -1
						   j gerarPersonagem_L

	MOVE:
	       	lui  $k0, 0xffff # endereco reservado para entrada do teclado
	        addi $s5, $zero, 'a'
	        addi $s6, $zero, 'd'
       
		INPUT:
			lw  $t9, 0($k0) # t9: tecla pressionada? (0/1)
	       		beq $t9, $zero, no_keypress
       		
       			lw  $t7, 4($k0) # t7: tecla pressionada ASCII
      			beq $t7, $s5, key_A
       			beq $t7, $s6, key_D
       		
       			j no_keypress # tecla inválida
	
		 key_A: # ESQUERDA
		 	jal gerarCenario
		 	lui $s0, 0x1001     # inicio do endereco de memoria
			add $k1, $zero, 128 # L: quantidade de UG na linha
		 	jal gerarCrocodilo
		 	addi $s1, $s1, -12 # -12 bytes de deslocamento
		 	j switchSTATE
		 	
		 key_D: # DIREITA
		 	jal gerarCenario
		 	lui $s0, 0x1001     # inicio do endereco de memoria
			add $k1, $zero, 128 # L: quantidade de UG na linha
		 	jal gerarCrocodilo
		 	addi $s1, $s1, 12 # +12 bytes de deslocamento
		 	j switchSTATE
		 	
		 switchSTATE:
		 	beq $fp, -1, changeSTATE_to_1
		 	beq $fp,  1, changeSTATE_to_2
		 	
		 	changeSTATE_to_1: addi $fp, $zero,  1
		 			  j jal_Personagem
		 			  
		 	changeSTATE_to_2: addi $fp, $zero, -1
		 	
		 	jal_Personagem: jal Personagem
	 	
		 	j no_keypress
	
		no_keypress: j INPUT